import React, { useState } from 'react';

const BuyNow = ({ selectedItems }) => {
    const [cardInfo, setCardInfo] = useState({
        cardNumber: '',
        cardName: '',
        expires: '',
        cvc: '',
    });
    const [orderPlaced, setOrderPlaced] = useState(false);

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setCardInfo({
            ...cardInfo,
            [name]: value,
        });
    };

    const handleBuyNow = () => {
        // You can handle payment processing here
        // For simplicity, let's assume the payment was successful
        setOrderPlaced(true);
    };

    return (
        <div className="container" style={{ backgroundColor: 'floralwhite', width: '70%', marginBottom: '30px' }}>
            <h2 className="pb-3 fs-4">Order Summary</h2>
            <table className="table table-borderless table-hover" style={{ fontFamily: 'Arial', backgroundColor: '#f7f7f7' }}>
                <thead>
                    <tr>
                        <th className="col-4">Item</th>
                        <th className="col-4">Price</th>
                        <th className="col-4">Quantity</th>
                    </tr>
                </thead>
                <tbody>
                    {selectedItems.map((item, index) => (
                        <tr key={index}>
                            <td className="col-4">
                                <span>{item.name}</span>
                            </td>
                            <td className="col-4">
                                <span>&#8377;{item.price}</span>
                            </td>
                            <td className="col-4">
                                <span>{item.quantity}</span>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <h4 className="mt-4">Total: &#8377;{selectedItems.reduce((total, item) => total + item.price * item.quantity, 0)}</h4>

            {orderPlaced ? (
                <div className="alert alert-success" role="alert">
                    Order Successfully Placed
                </div>
            ) : (
                <div>
                    <h2 className="pb-3 fs-4">Payment Information</h2>
                    <div className="mb-3">
                        <label htmlFor="cardNumber" className="form-label">Card Number</label>
                        <input
                            type="text"
                            className="form-control"
                            id="cardNumber"
                            name="cardNumber"
                            value={cardInfo.cardNumber}
                            onChange={handleInputChange}
                        />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="cardName" className="form-label">Name on Card</label>
                        <input
                            type="text"
                            className="form-control"
                            id="cardName"
                            name="cardName"
                            value={cardInfo.cardName}
                            onChange={handleInputChange}
                        />
                    </div>
                    <div className="row">
                        <div className="col-6">
                            <div className="mb-3">
                                <label htmlFor="expires" className="form-label">Expires</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    id="expires"
                                    name="expires"
                                    value={cardInfo.expires}
                                    onChange={handleInputChange}
                                />
                            </div>
                        </div>
                        <div className="col-6">
                            <div className="mb-3">
                                <label htmlFor="cvc" className="form-label">CVC</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    id="cvc"
                                    name="cvc"
                                    value={cardInfo.cvc}
                                    onChange={handleInputChange}
                                />
                            </div>
                        </div>
                    </div>

                    <button type="button" className="btn btn-primary" onClick={handleBuyNow}>
                        Buy Now
                    </button>
                </div>
            )}
        </div>
    );
};

export default BuyNow;
